  import React, { Component } from 'react'
  import Header from '../components/Header/Header.js';
  import Search from '../components/ProfileBlocks/Search/Search.js';
  import Background from '../components/Background/Background.js';
  import Footer from '../components/Footer/Footer.js';
  import ProfileBlocks from '../components/ProfileBlocks/Student/ProfileBlocks.js';
  import SideMenu from '../components/SideMenu/SideMenu.js';

  export default class ProfileStudent extends Component {
    constructor(props) {
      super(props);
      this.state = {
        isAuthenticated: true,
        isSideMenuOpen: false
      };
    }
    toggleMenu = () => {
      this.setState(prevState => ({ isSideMenuOpen: !prevState.isSideMenuOpen }));
    };
    render() {
      const { isAuthenticated } = this.state;
      return (
        <Background>
          <Header isAuthenticated={isAuthenticated} toggleMenu={this.toggleMenu}/>
          <SideMenu toggleMenu={this.toggleMenu} />
        <Search/>
        <ProfileBlocks/>
          <Footer/>
          </Background>

      )
    }
  }
